mapper.select:
select count(1) from (select FUNDS_MARKET.IS_RECOMM, tmp.* from (SELECT THS001.F001_THS001, THS001.F002_THS001, THS001.F003_THS001,THS001.F005_THS001, THS035.* FROM THS001, THS035 where THS035.F001_THS035 = THS001.F001_THS001) tmp LEFT JOIN FUNDS_MARKET ON tmp.F002_THS001 = FUNDS_MARKET.FUNDS_CODE
order by ${orderByClause}
)
